import React from "react"

export default function LoginPage() {

    function loginClicked() {
        console.log("logg")
    }

    return (
        <div className="login-rect">
            <div className="login-title">Login</div>

            <div className="username-label">Username</div>
            <input className="username-field" type="text" name="username" required/>

            <div className="password-label">Password</div>
            <input className="password-field" type="password" name="password" required/>

            <div className="login-button" onClick={loginClicked}>Login</div>
        </div>
    )
}
